import Header from './Header';

const layoutStyle = {
  textAlign: 'center',
  listStyle: 'none',
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const Layout = props => (
  <div style={layoutStyle}>
  <Header />
    {props.children}
    </div>
);

export default Layout;
